import React from 'react';

function App() {
  var counter = 0;
  function incrementCounter(){
    counter ++;
  }
  return (
    <>
      <h1>Contador: {counter}</h1>
      <button onClick={incrementCounter}>Inrementar</button>
    </>
  );
}

export default App;
